import React from 'react';
import {Grid,Paper} from '@material-ui/core';

const Signup=()=>{
    const paperStyle={padding:"30px 20px", width:300,margin:"20px auto"}
    return(
    <Grid>
        <Paper elevation={20} style={paperStyle}>
         <h2>Sign Up</h2>
        </Paper>
    </Grid>
    )

}


export default Signup;
